		FROM MasterClientCoverage..TempJaPageDetailTable   PDT with (nolock)
		LEFT OUTER JOIN masteradviewdata.dbo.adviewmain CWM with (nolock) on pdt.flyerid = cwm.flyerid
		LEFT OUTER JOIN EntryData.dbo.MasterRollupFlyerIds ru with (nolock) on pdt.flyerid = ru.flyerid
		LEFT OUTER JOIN tempdb.dbo.vwWeightScore ws with (nolock) on cwm.retmktid = ws.retmktid 
		and case when ru.flyerid is not null then case when pdt.EntryTaggedCompany = 'C' then 'B' when pdt.EntryTaggedCompany = 'D' then 'C' else pdt.EntryTaggedCompany end
		else pdt.EntryTaggedCompany end = ws.TaggedCompany
		LEFT OUTER JOIN tempdb.dbo.FlyersToCheck360 F360 on F360.FlyerId = CWM.FlyerID
		Left JOIN masteradviewdata.dbo.MCAPVehiclePages vp on pdt.flyerid = vp.flyerid and pdt.page = vp.pagenumber 
